import {
  Alert,
  Image,
  Linking,
  Platform,
  ScrollView,
  StyleSheet,
  Text,
  TouchableOpacity,
  View,
} from 'react-native';
import Footer from '../components/Footer';
import Header from '../components/Header';

export default function HasilNegatif({ route, navigation }) {
  const {
    nama = 'Nama Tidak Diketahui',
    probabilitas = 0.0,
    hasil = 'Negatif',
    tanggal,
  } = route.params || {};

  const tanggalScreening = tanggal || new Date().toISOString();

  const showAlert = (message, title = 'Peringatan') => {
    if (Platform.OS === 'web') {
      alert(`${title}\n\n${message}`);
    } else {
      Alert.alert(title, message);
    }
  };

  const handleKembali = () => navigation.navigate('MainMenu');

  const handleHubungiKami = () => {
    const nomorWA = '6281274489306';
    const pesan =
      'Halo, saya ingin konsultasi mengenai hasil screening TBC saya.';
    const url = `https://wa.me/${nomorWA}?text=${encodeURIComponent(pesan)}`;

    Linking.openURL(url).catch((err) => {
      console.error('Gagal membuka WhatsApp', err);
      showAlert('Gagal membuka WhatsApp. Pastikan Anda memiliki aplikasi WhatsApp.', 'Error');
    });
  };

  const tanggalFormatted = new Date(tanggalScreening).toLocaleDateString('id-ID', {
    day: '2-digit',
    month: 'long',
    year: 'numeric',
  });

  return (
    <View style={{ flex: 1, backgroundColor: '#fff' }}>
      <Header />
      <ScrollView
        contentContainerStyle={{ flexGrow: 1, justifyContent: 'space-between' }}
        style={{ flex: 1 }}
      >
        <View style={{ padding: 20, flex: 1, alignItems: 'center' }}>
          <Text style={styles.header}>SCREENING TBC</Text>
          <Text style={styles.subHeader}>
            TBC itu bisa diobati kok, Telaten minum obat dan rutin kontrol. Jangan takut untuk memeriksakan diri!
          </Text>

          <View style={styles.card}>
            <Image
              source={require('../assets/images/Sehat.png')}
              style={styles.image}
              resizeMode="contain"
            />
            <View style={styles.identityBox}>
              <Text style={styles.name}>{nama}</Text>
              <Text style={styles.date}>{tanggalFormatted}</Text>
            </View>
            <Text style={styles.result}>Anda Tidak Terduga TBC</Text>
            <Text style={styles.prob}>Probabilitas: {(probabilitas * 100).toFixed(2)}%</Text>
          </View>

          <Text style={styles.footerNote}>
            Tetap jaga kesehatan dan lakukan pemeriksaan rutin bila diperlukan!
          </Text>

          <View style={styles.buttonGroup}>
            <TouchableOpacity style={[styles.button, styles.whatsapp]} onPress={handleHubungiKami}>
              <Text style={styles.buttonText}>Hubungi Kami</Text>
            </TouchableOpacity>
            <TouchableOpacity style={[styles.button, styles.secondaryButton]} onPress={handleKembali}>
              <Text style={styles.secondaryButtonText}>Kembali ke Halaman Awal</Text>
            </TouchableOpacity>
          </View>
        </View>

        <Footer />
      </ScrollView>
    </View>
  );
}

const styles = StyleSheet.create({
  header: {
    fontSize: 22,
    fontWeight: 'bold',
    color: 'red',
    textAlign: 'center',
    marginBottom: 8,
  },
  subHeader: {
    fontSize: 14,
    textAlign: 'center',
    marginBottom: 20,
  },
  card: {
    borderRadius: 8,
    backgroundColor: '#f2f2f2',
    padding: 20,
    width: '100%',
    alignItems: 'center',
  },
  image: {
    width: 160,
    height: 160,
    marginBottom: 20,
  },
  identityBox: {
    backgroundColor: '#fff',
    borderRadius: 8,
    paddingVertical: 10,
    paddingHorizontal: 20,
    marginBottom: 16,
    alignItems: 'center',
    elevation: 2,
  },
  name: {
    fontSize: 16,
    fontWeight: 'bold',
    color: '#333',
  },
  date: {
    fontSize: 14,
    color: '#777',
  },
  result: {
    fontSize: 18,
    fontWeight: 'bold',
    color: 'green',
    marginBottom: 8,
  },
  prob: {
    fontSize: 14,
    color: '#333',
    textAlign: 'center',
  },
  footerNote: {
    marginTop: 24,
    fontSize: 14,
    color: '#666',
    textAlign: 'center',
  },
  buttonGroup: {
    marginTop: 24,
    width: '100%',
    alignItems: 'center',
    gap: 12,
  },
  button: {
    padding: 14,
    borderRadius: 6,
    alignItems: 'center',
    minWidth: '80%',
  },
  whatsapp: {
    backgroundColor: '#25D366',
  },
  secondaryButton: {
    backgroundColor: '#eee',
  },
  secondaryButtonText: {
    color: '#333',
    fontWeight: 'bold',
  },
  buttonText: {
    color: '#fff',
    fontWeight: 'bold',
  },
});
